    do {
        let parsedHtml = try Specta.parse(data)

        // Example: Extracting all hyperlinks
        var links = parsedHtml["body"]?.children["a"].map({ $0["href"] })?? []

        return links
    } catch {
        fatalError("Failed to parse HTML")
    }
}

